import React from 'react'

import './help.css'

const Help = ({active, setActive}) => {
  return (
    <div className={active ? "help active" : "help"}>
        <div className="help__content" onClick={e => e.stopPropagation()}>
            <a href="#" onClick={() => setActive(false)}><img src="https://img.icons8.com/ios-glyphs/30/000000/delete-sign.png"/></a>

        </div>
    </div>
  )
}

export default Help
